import React from 'react'

const BookShow = ({ book }) => {
    return <div className="book-show">
      <img alt="" src={`https://picsum.photos/seed/${book.id}picsum/200/300`} />
      <h3>{book.title}</h3>
    </div>;
  };
  
  export default BookShow;
